description:
Movie Info: Super Model is a 2013 Hindi romantic thriller featuring Veena Malik and Ashmit Patel in the lead roles. The supporting cast includes Harsh Chhaya and Jackie Shroff. It was released in theatres on September 27.

The film has been produced by Ravi Ahlawat of Eye Telefilms Pvt. Ltd and directed by Navin Batra. Prem Prakash Gupta is the associate producer of the film and music has been given by DJ Sheizwood. Super Model will be released worldwide by Pen N Camera International Pvt. Ltd.

